def iroot(x, e):
    lo = 0
    hi = 1 << ((x.bit_length() // e) + 2)
    while lo + 1 < hi:
        mid = (lo + hi) // 2
        if mid**e <= x:
            lo = mid
        else:
            hi = mid
    return lo

